import React from 'react'
import successImage from '../../images/ok_success_icon.svg'

const NotificationBox = ({ response, responseData }) => {
    console.log(response)

    if (response){
        if (response.status === 409){
            return (
                <div>
                    <b>Hola {''}{response.data}</b>, {responseData.errorMessage}
                </div>    
            )
        }
        if (response.status === 201){
            return (
                <div>
                    <img src="../../images/ok_success_icon.svg" alt="successImage" />
                    <b>Hola {''}{response.data}</b>, {responseData.successMessage}
                    {/* {response.data + ' ' +  responseData.successMessage} */}
                </div>
            )
        }
        if (response.status === 500) {
            return (
                <div>
                    <b>ha ocurrido interno en nuestro servidor, pedimos disculpas...</b>
                </div>
            )
        }
    }
    return null     

}

export default NotificationBox
